@Erik W People pick up on things related to their trade, I've done a fair amount of instruction as well and the instructor in this one does a good job, but really for any type of profession that deals with talking you need both viewer critique and to watch recordings of your own material. 

Teaching is an art, there is some science behind it and there is no one right way of doing it that works for every situation, and in tutorials it is even a bit more problematic, if I'm in a classroom I can keep an eye on my learners and look for cues on how to moderate the pace of the lesson and how much iteration and how far in depth we need to go.

